import styled, { css } from "styled-components"

const primaryColor = css`
    color:#448487
`
const Homepage = styled.div`
background-color:pink;
    margin:0 auto;
    ${primaryColor};
    .cover{
        margin:30px auto;
        background-position:cover;
        background-repeat:no-repeat;
        width: 100vw;
        height:700px
    }
`
export default Homepage
